Item.method_code:
if (this.computeCorrectControlState) {
	var cmd;
	var isUnlockEnabled = this.getUnlockFlg();
	var isLockEnabled = this.computeCorrectControlState('lock');
	if (isUnlockEnabled) {
		cmd = 'unlock';
	} else if (isLockEnabled) {
		cmd = 'lock';
	}

	if (cmd) {
		this.processCommand(cmd);
		this.focus();
	}
}
